import { useState } from "react";

function Navlinks () {

    const Navrouter = [["Home"], ["Blog"], ["Portafolio"],["About" ]]
    const [open, setOpen] = useState(false);
    return(
        <div>
            <nav className="px-3" >
                {Navrouter.map(([title])=> (
                    <div>
                        <div className={`  text-left md:cursor-pointer md:hidden bg-gray-100 fixed w-full top-0 overflow-y-auto bottom-0 py-20 pl-4 duration-500 ${
          open ? "left-0" : "left-[-100%]"
        }`}>
                            <a >{title}</a>
                        </div>
                    </div>
                ))}
            </nav>
        </div>
    )
}

export default Navlinks;
